import React from 'react';
import { FaExchangeAlt } from 'react-icons/fa';
import StyledSidebar from './styles';

function SideBar() {
    return (
        <StyledSidebar>
            <nav>
                <ul>
                    <li>
                        <Link to="/">
                            Transactions <FaExchangeAlt />
                        </Link>
                    </li>
                </ul>
            </nav>
        </StyledSidebar>
    );
}

export default SideBar;
